import './App.css';
import Counter from './Counter';
import { useSelector } from "react-redux";
import { ICounter } from "./redux/store/counterReducer";

function App() {
  const count: ICounter = useSelector((state: ICounter) => state.count);
  console.log(count);

  const voters: string[] = [
    "Anthony Sistilli ",
    "Bob Smith",
    "Stephanie Foo",
    "Kevin Ma"
  ];

  return (
    <div className="App">
      {voters.map(voter => (
        <Counter name={voter} />
      ))}
    </div>
  );
}

export default App;
